        main areaThis is main area This is main areaThis is main areaThis is main area This is main area
        </Paper>
      </Grid>
      <Grid item>
        <Card>
          <CardMedia
            image="/public/images/future.png"
          />
          <Typography>this is card</Typography>
        </Card>
      </Grid>

    </Grid>
  );
}
